int partition(int *seq,int left,int right)
{
	int base = seq[left];
	
	while (left < right)
	{
		while (left < right && seq[right] >= base)//使用>=可保证严平稳有序
		{
			right--;
		}
		
		seq[left] = seq[right];
		
		while(left < right && seq[left] <= base)
		{
			left++;
		}
		seq[right] = seq[left];
	}

	seq[left] = base;
	return left;
}


void quicksort(int *seq,int left,int right)
{
	int pivotloc = 0;

	if (left < right)//保证待排序序列起码有两个元素
	{
		pivotloc = partition(seq,left,right);
		quicksort(seq,left,pivotloc);
		quicksort(seq,pivotloc+1,right);
	}
}

